import React from 'react'
import Articulo from "./Articulo"



function GenerateArticles(props){
    
    return(
        <React.Fragment>
            <Articulo/>
        </React.Fragment>

    )
    
    

}

function Articulos() {
    
    return (
        <React.Fragment>
        <div>
            <h2>Pagina de noticias</h2>
            <GenerateArticles/>
        </div>
        </React.Fragment>
        
    )
}
export default Articulos;
